package decoder

import (
	"testing"
)

func Test1Pack2L(t *testing.T) {
	doTableTest(t, NewPack2Decoder, littleEndian, pack2LTestTable1, "unwrapped")
}

func Test1Pack2(t *testing.T) {
	doTableTest(t, NewPack2Decoder, bigEndian, pack2TestTable1, "unwrapped")
}

func Test2Pack2(t *testing.T) {
	doTableTest(t, NewPack2Decoder, bigEndian, pack2TestTable2, "unwrapped")
}

func TestPack2BigID(t *testing.T) {
	doTableTest(t, NewPack2Decoder, littleEndian, pack2LTestTableBigID, "unwrapped")
}

var pack2LTestTableBigID = testTable{ // little endian
	{[]byte{61, 39, 217, 255, 4, 3, 2, 1, 7, 6, 5, 0}, `tst:TRICE8_7 1 2 3 4 5 6 7`},
	{[]byte{62, 24, 33, 244, 4, 3, 2, 1, 8, 7, 6, 5}, `tst:TRICE8_8 1 2 3 4 5 6 7 8`},
}

var pack2TestTable2 = testTable{ // big endian
	{[]byte{5, 250, 16, 24}, `--------------------------------------------------`},
	{[]byte{5, 250, 16, 25}, `--------------------------------------------------`},
	{[]byte{5, 250, 16, 25}, "warning:Cycle 25 does not match expected cyle 26 - lost trice messages?\n--------------------------------------------------"},
	{[]byte{5, 250, 16, 26}, `--------------------------------------------------`},
}

